import {Card,Button} from 'antd'
export default class Bar extends Component {
    render() {
        return (
            <div>
                <Card>
                    <Button type='primary' onClick={this.update}>更新</Button>
                </Card>
                <Card title='柱状图一'></Card>
            </div>
        )
    }
}
